import React, { Component } from 'react';
import { Container, Row, Col } from 'react-bootstrap';
import '../Navbar/Navbar.css';


export class Navbar extends Component {
    render() {
        return(

        <div className="navbar">
            <ul>
            <li>Home</li>
            <li>My Patients</li>
            <li>Notifications</li>
            <li>Upload Content</li>
            <li>My Content</li>
            <li>My Profile</li>
            </ul>
        </div>

        );
    }
}
